var mod_pagespeed_qnua4hEtjB = "/*\n--------------------------------\nAjax Contact Form\n--------------------------------\n+ https://github.com/mehedidb/Ajax_Contact_Form\n+ A Simple Ajax Contact Form developed in PHP with HTML5 Form validation.\n+ Has a fallback in jQuery for browsers that do not support HTML5 form validation.\n+ version 1.0.1\n+ Copyright 2016 Mehedi Hasan Nahid\n+ Licensed under the MIT license\n+ https://github.com/mehedidb/Ajax_Contact_Form\n*/\n\n(function ($, window, document, undefined) {\n    'use strict';\n\n    var $form = $('#contact-form');\n\n    $form.submit(function (e) {\n        // remove the error class\n        $('.form-group').removeClass('has-error');\n        $('.help-block').remove();\n\n        // get the form data\n        var formData = {\n            'name' : $('input[name=\"form-name\"]').val(),\n            'email' : $('input[name=\"form-email\"]').val(),\n            'subject' : $('input[name=\"form-subject\"]').val(),\n            'message' : $('textarea[name=\"form-message\"]').val()\n        };\n\n        // process the form\n        $.ajax({\n            type : 'POST',\n            url  : 'process.php',\n            data : formData,\n            dataType : 'json',\n            encode : true\n        }).done(function (data) {\n            // handle errors\n            if (!data.success) {\n                if (data.errors.name) {\n                    $('#name-field').addClass('has-error');\n                    $('#name-field').find('.col-lg-10').append('<span class=\"help-block\">' + data.errors.name + '</span>');\n                }\n\n                if (data.errors.email) {\n                    $('#email-field').addClass('has-error');\n                    $('#email-field').find('.col-lg-10').append('<span class=\"help-block\">' + data.errors.email + '</span>');\n                }\n\n                if (data.errors.subject) {\n                    $('#subject-field').addClass('has-error');\n                    $('#subject-field').find('.col-lg-10').append('<span class=\"help-block\">' + data.errors.subject + '</span>');\n                }\n\n                if (data.errors.message) {\n                    $('#message-field').addClass('has-error');\n                    $('#message-field').find('.col-lg-10').append('<span class=\"help-block\">' + data.errors.message + '</span>');\n                }\n            } else {\n                // display success message\n                $form.html('<div class=\"alert alert-success\">' + data.message + '</div>');\n            }\n        }).fail(function (data) {\n            // for debug\n            console.log(data)\n        });\n\n        e.preventDefault();\n    });\n}(jQuery, window, document));\n";
